Objeto:
execução de serviços Magnetometria Terrestre, localizada no Município de Nova Mutum, a +/- 40 km da sede do município. Trata-se de uma área de agricultura permanente (soja/algodão/milho), de topografia plana, de fácil acesso. SERVIÇOS: Levantamento terrestre com magnetômetro das anomalias magnéticas apresentadas numa área de 3,2 km por 2,5 km, em malha de 200 m totalizando 40 km, e a interpretação e mapeamento desses dados com apresentação dos produtos relacionados a seguir:PRODUTOS:
a) Localização em terra da anomalia apresentada na magnetometria aérea;
b) Profundidade, coordenadas e forma plotada da anomalia;
c) Mapas dos produtos finais: Campo Magnético Total, Primeira Derivada Vertical, Sinal Analítico, Mapa de Soluções Euler, Mapa de Source Edge Detec, estes mapas deveram ser elaborados sobre mapas topográficos na escala 1:25.000 e 1:5.000;
d) Localização dos melhores pontos para os primeiros furos de sondagem.
e) Devera ser entregue um relatório final

